import React from "react";
import styled from "styled-components";
import TodoItem from "./TodoItem";

const StyleTodo = styled.div`
    border: 1px solid red;
    width: 800px;
    height: 1000px;
    margin: auto;
    margin-top: 150px;
`;

const Input = styled.div`
    margin: auto;
    margin-left: 2000px;
`;

const Todo = () => {
    return (
        <StyleTodo>
            <Input>
                <input></input>
                <button>Enter</button>
            </Input>
            <TodoItem />
            <TodoItem />
            <TodoItem />
            <TodoItem />
            <TodoItem />
        </StyleTodo>
    );
};

export default Todo;
